import { Negation } from './dependency';

/**
 * @ignore
 */
const Pow = new CharSet('^');

/**
 * @desc
 * Exponentiation Parser
 */
export default class Exponentiation extends Matcher {
  /**
   * @desc
   * Given a feed, attempt to match and consume
   * the prefix of a feed.
   * @param {Feed} feed
   * @returns {Number|undefined}
   */
  // eslint-disable-next-line class-methods-use-this
  parse(feed) {
    // eslint-disable-next-line class-methods-use-this
    if (feed instanceof Feed) {
      const r = new Sequence([
        new Negation(),
        new Quantifier(
          new Sequence([
            Pow,
            new Exponentiation(),
          ]),
          0,
        ),
      ]).parse(feed);

      const quantified = r[1];
      const sequence = quantified[0];
      if (sequence instanceof Array) {
        return r[0] ** sequence[1];
      }
      return r[0];
    }
    return undefined;
  }
}

