import {
  Matcher, Feed, Sequence, Quantifier, Alternation, CharSet,
} from 'parexgram-js';
import { Exponentiation } from './dependency';


/**
 * @ignore
 */
const Mul = new CharSet('*');
/**
 * @ignore
 */
const Div = new CharSet('/');
/**
 * @desc
 * Multiplication Parser
 */
export default class Multiplication extends Matcher {
  /**
   * @desc
   * Given a feed, attempt to match and consume
   * the prefix of a feed.
   * @param {Feed} feed
   * @returns {Number|undefined}
   */
  // eslint-disable-next-line class-methods-use-this
  parse(feed) {
    // eslint-disable-next-line class-methods-use-this
    if (feed instanceof Feed) {
      const r = new Sequence([
        // eslint-disable-next-line class-methods-use-this
        new Exponentiation(),
        new Quantifier(
          new Sequence([
            new Alternation([Mul, Div]),
            new Multiplication(),
          ]),
          0,
        ),
      ]).parse(feed);
      const quantified = r[1];
      const sequence = quantified[0];
      if (sequence instanceof Array) {
        if (sequence[0] === '*') {
          return r[0] * sequence[1];
        }
        if (sequence[0] === '/') {
          return r[0] / sequence[1];
        }
      }
      return r[0];
    }
    return undefined;
  }
}

