import {
  CharSet, Matcher, Feed, Sequence, Quantifier,
} from 'parexgram-js';
import { Atom } from './dependency';


/**
 * @ignore
 */
const Neg = new CharSet('-');
/**
 * @desc
 * Negation Parser
 */
export default class Negation extends Matcher {
  /**
   * @desc
   * Given a feed, attempt to match and consume
   * the prefix of a feed.
   * @param {Feed} feed
   * @returns {Number|undefined}
   */
  // eslint-disable-next-line class-methods-use-this
  parse(feed) {
    if (feed instanceof Feed) {
      const r = new Sequence([
        new Quantifier(Neg, 0, 1),
        new Atom(),
      ]).parse(feed);

      if (r[0][0] === '-') {
        return -r[1];
      }
      return r[1];
    }
    return undefined;
  }
}

